import React from 'react';

const About = () => {
  const textStyle = {
    position: 'fixed',
    top: '60px', // Position it below the TopStrip (adjust the value based on the height of your TopStrip)
    left: '10px', // Align to the left edge
    padding: '10px',
    color: 'black',
    fontSize: '1.5em', // Corrected font size unit
    zIndex: '1000', // Ensures the text is always on top
    fontStyle: 'italic', // Corrected property name
  };

  return (
    <div style={textStyle}>
      <h1>
        I was bored and thought it would be fun to hack this together. Msg me at
        mirbahri@ucla.edu if you have any cool ideas to improve this project. <br /> <br />
        - mdawg96
      </h1>
    </div>
  );
};

export default About;
